Pain is a wonderful guide. When it comes to physical pain in the body from training, it lets us know if something we’re doing is hurting or helping.

But what about when something isn’t right, but there’s no pain to offer guidance?

For years I’ve been telling athletes that pain is trying to help us after I learned the hard way in the past not to push through it. 

With my current situation, part of me wonders if ignoring the pain in the past led my body to not bother feeling pain when things went wrong. Or maybe the universe didn’t want me to use running as an outlet for everything life threw at me the past few years? Or, logically, my nerves were damaged, though the past few years taught me that logic isn’t always the answer. 

I could dwell on this longer, but my power is in the now. After deciding not to go the surgery route, rest, two PRP sessions, and lots of rehab, it feels like progress is being made. Maybe not as fast as I’d like, but I can feel it. 

And in the meantime, joy comes from sunsets over mountains, family adventures, friends, snow (never thought I'd say that, but skiing has been a blast), a friendly conversation with a cashier, a warm drink on a cold day, a book, and a fluffy niece (woof!) who is always up to play or cuddle.

